import React, { useState } from "react";
import axios from "axios";
import Navbar from "../Component/Navbar";
import "./Calc.css"; // Add CSS for styling if needed

function Home() {
  const [electricityData, setElectricityData] = useState({ kwh: "" });
  const [dietChoice, setDietChoice] = useState("");
  const [travel, setTravel] = useState("");
  const [distance, setDistance] = useState("");
  const [result, setResult] = useState(null);

  const handleSubmit = async (e) => {
    e.preventDefault();

    if (!electricityData.kwh || !dietChoice || !travel || !distance) {
      alert("Please fill in all the required fields!");
      return;
    }

    try {
      const payload = {
        electricity: electricityData.kwh,
        diet: dietChoice,
        travel: travel,
        dist: distance,
      };

      const response = await axios.post("http://localhost:8080/products/calculate", payload);
      setResult(response.data.totalCarbon);
      alert(`Your carbon footprint is ${response.data.totalCarbon} kg CO2`);
    } catch (error) {
      console.error("Error:", error.response ? error.response.data : error.message);
      alert("Failed to calculate carbon footprint. Please try again.");
    }
  };

  return (
    <div>
      <Navbar />
      <div className="app-container">
        <h1>Welcome to the Carbon Footprint Calculator</h1>
        <form onSubmit={handleSubmit} className="calculator-form">
          {/* Electricity */}
          <div className="section">
            <label>
              Electricity used (kWh):
              <input
                type="number"
                placeholder="Enter kWh"
                value={electricityData.kwh}
                onChange={(e) =>
                  setElectricityData({ ...electricityData, kwh: e.target.value })
                }
              />
            </label>
          </div>

          {/* Diet */}
          <div className="section">
            <label>Diet:</label>
            <label>
              <input
                type="radio"
                name="diet"
                value="veg"
                checked={dietChoice === "veg"}
                onChange={() => setDietChoice("veg")}
              />
              Veg
            </label>
            <label>
              <input
                type="radio"
                name="diet"
                value="nonveg"
                checked={dietChoice === "nonveg"}
                onChange={() => setDietChoice("nonveg")}
              />
              Non-Veg
            </label>
            <label>
              <input
                type="radio"
                name="diet"
                value="vegan"
                checked={dietChoice === "vegan"}
                onChange={() => setDietChoice("vegan")}
              />
              Vegan
            </label>
          </div>

          {/* Travel */}
          <div className="section">
            <label>
              Transport Mode:
              <select
                value={travel}
                onChange={(e) => setTravel(e.target.value)}
                className="travel-select"
              >
                <option value="">Select transport mode</option>
                <option value="bike">Bike</option>
                <option value="petrol_car">Petrol Car</option>
                <option value="diesel_car">Diesel Car</option>
                <option value="bus">Bus</option>
                <option value="metro">Metro</option>
              </select>
            </label>
            {travel && (
              <label>
                Distance (km):
                <input
                  type="number"
                  placeholder="Enter distance in km"
                  value={distance}
                  onChange={(e) => setDistance(e.target.value)}
                />
              </label>
            )}
          </div>

          <button type="submit">Calculate</button>
        </form>

        {result && (
          <div className="result">
            <h3>Your Carbon Footprint:</h3>
            <p>{result} kg CO2</p>
          </div>
        )}
      </div>
    </div>
  );
}

export default Home;
